import "../css/Home.css";
import Navbar from "../components/Navbar";
import { useNavigate } from "react-router-dom";

const Home = () => {
  const navigate = useNavigate();
  return (
    <div>
      <Navbar />
      <button
        onClick={() => {
          navigate(`/newcode`);
        }}
      >
        Create new access code!
      </button>
    </div>
  );
};

export default Home;
